var input = [
  "",
  "",
  "",
  "",
  ""
];

var keypad = [
  [0,0,1,0,0],
  [0,2,3,4,0],
  [5,6,7,8,9],
  [0,'A','B','C',0],
  [0,0,'D',0,0],
]
var cordinates = [1, 1];
for (var i = 0; i < input.length; i++) {
  var instructions = input[i].split('');
  for (var p = 0; p < instructions.length; p++) {
    var nextStep = instructions[p];
    switch (nextStep) {
      case 'U':
        if (cordinates[0] > 0 && keypad[cordinates[0] - 1][cordinates[1]] !== 0) {
          cordinates[0] = cordinates[0] - 1;
        }
        break;
      case 'D':
        if (cordinates[0] < 4 && keypad[cordinates[0] + 1][cordinates[1]] !== 0) {
          cordinates[0] = cordinates[0] + 1;
        }
        break;
      case 'L':
        if (cordinates[1] > 0 && keypad[cordinates[0]][cordinates[1] - 1] !== 0) {
          cordinates[1] = cordinates[1] - 1;
        }
        break;
      case 'R':
        if (cordinates[1] < 4 && keypad[cordinates[0]][cordinates[1] + 1] !== 0) {
          cordinates[1] = cordinates[1] + 1;
        }
        break;
      default:
        console.log("Error");
        break;
    }
  }
  console.log(keypad[cordinates[0]][cordinates[1]]);
}
